INSERT INTO cdm_observable_asset.PriceTypeEnum (PriceTypeEnum, Description) VALUES ('AssetPrice', 'Denotes a price expressed as a cash amount in a given currency to purchase a unit of an asset (e.g. a security or a commodity).');
