INSERT INTO cdm_observable_asset.PriceTypeEnum (PriceTypeEnum, Description) VALUES ('Correlation', 'Denotes a price expressed as the weighted average of all pairwise correlation coefficients.');
INSERT INTO cdm_observable_asset.PriceTypeEnum (PriceTypeEnum, Description) VALUES ('Dividend', 'Denotes a price expressed as the dividend payment from a index or share.');
INSERT INTO cdm_observable_asset.PriceTypeEnum (PriceTypeEnum, Description) VALUES ('ExchangeRate', 'Denotes a rate to convert one currency or other measure of value to another. Foreign Exchange rates are represented in decimals, e.g. {amount, unitOfAmount, PerUnitOfAmount} = [1.23, USD, GBP] = USD 1.23 for every 1 GBP.');
INSERT INTO cdm_observable_asset.PriceTypeEnum (PriceTypeEnum, Description) VALUES ('InterestRate', 'Denotes a price expressed as a rate to be applied to quantity/notional amount and represented as decimal, e.g. {amount, unitOfAmount, PerUnitOfAmount} = [0.08, EUR, EUR] = 8%  of the EUR notional quantity/amount or 8 cents for every EUR of notional amount.');
INSERT INTO cdm_observable_asset.PriceTypeEnum (PriceTypeEnum, Description) VALUES ('Variance', 'Denotes a price expressed as the the arithmetic average of the squared differences from the mean value of an observable price.');
INSERT INTO cdm_observable_asset.PriceTypeEnum (PriceTypeEnum, Description) VALUES ('Volatility', 'Denotes a price expressed as the the square root of the arithmetic average of the squared differences from the mean value of an observable price.');
