INSERT INTO cdm_base_staticdata_party.TelephoneTypeEnum (TelephoneTypeEnum, Description) VALUES ('Fax', 'A number used primarily for work-related facsimile transmissions.');
INSERT INTO cdm_base_staticdata_party.TelephoneTypeEnum (TelephoneTypeEnum, Description) VALUES ('Mobile', 'A number on a mobile telephone that is often or usually used for work-related calls. This type of number can be used for urgent work related business when a work number is not sufficient to contact the person or firm.');
INSERT INTO cdm_base_staticdata_party.TelephoneTypeEnum (TelephoneTypeEnum, Description) VALUES ('Personal', 'A number used primarily for non work-related calls. (Normally this type of number would be used only as an emergency backup number, not as a regular course of business).');
INSERT INTO cdm_base_staticdata_party.TelephoneTypeEnum (TelephoneTypeEnum, Description) VALUES ('Work', 'A number used primarily for work-related calls. Includes home office numbers used primarily for work purposes.');
INSERT INTO cdm_observable_asset_calculatedrate.CalculationShiftMethodEnum (CalculationShiftMethodEnum, Description) VALUES ('Lookback', 'Calculations and weighting are done with respect to the calculation period, but observations are shifted back by several days.');
INSERT INTO cdm_observable_asset_calculatedrate.CalculationShiftMethodEnum (CalculationShiftMethodEnum, Description) VALUES ('NoShift', 'calculations occur without any shifting, e.g. OIS Compounding/Basic Averaging style.');
INSERT INTO cdm_observable_asset_calculatedrate.CalculationShiftMethodEnum (CalculationShiftMethodEnum, Description) VALUES ('ObservationPeriodShift', 'the observation period is shifted by several days prior to rate setting, and weightings are done with respect to the obseration period.');
INSERT INTO cdm_observable_asset_calculatedrate.CalculationShiftMethodEnum (CalculationShiftMethodEnum, Description) VALUES ('RateCutOff', 'Calculations cut the rate off several business days prior to rate setting (Lockout).');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('Contract', 'Denotes financial contracts, such as listed futures and options.');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('ContractualProduct', 'Denotes a Contractual Product as defined in the CDM.  This unit type would be used when the price applies to the whole product, for example, in the case of a premium expressed as a cash amount.');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('IndexUnit', 'Denotes a price expressed in index points, e.g. for a stock index.');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('LogNormalVolatility', 'Denotes a log normal volatility, expressed in %/month, where the percentage is represented as a decimal. For example, 0.15 means a log-normal volatility of 15% per month.');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('Share', 'Denotes the number of units of financial stock shares.');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('ValuePerDay', 'Denotes a value (expressed in currency units) for a one day change in a valuation date, which is typically used for expressing sensitivity to the passage of time, also known as theta risk, or carry, or other names.');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('ValuePerPercent', 'Denotes a value (expressed in currency units) per percent change in the underlying rate which is typically used for expressing sensitivity to volatility changes, also known as vega risk.');
INSERT INTO cdm_base_math.FinancialUnitEnum (FinancialUnitEnum, Description) VALUES ('Weight', 'Denotes a quantity (expressed as a decimal value) represented the weight of a component in a basket.');
INSERT INTO cdm_product_template.AveragingInOutEnum (AveragingInOutEnum, Description) VALUES ('Both', 'The average price is used to derive both the strike and the expiration price.');
INSERT INTO cdm_product_template.AveragingInOutEnum (AveragingInOutEnum, Description) VALUES ('In', 'The average price is used to derive the strike price. Also known as ''Asian strike'' style option.');
INSERT INTO cdm_product_template.AveragingInOutEnum (AveragingInOutEnum, Description) VALUES ('Out', 'The average price is used to derive the expiration price. Also known as ''Asian price'' style option.');
INSERT INTO cdm_base_staticdata_asset_common.CreditRiskEnum (CreditRiskEnum, Description) VALUES ('TranchedCreditRisk', 'Indicates tranched credit risk, including securitizations.');
INSERT INTO cdm_base_staticdata_asset_common.CreditRiskEnum (CreditRiskEnum, Description) VALUES ('UntranchedCreditRisk', 'Indicates tranched credit risk, including repackagings.');
