INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('AssetBacked', 'Identifies a debt instrument that has periodic income payments and value derived from or backed by a specified pool of underlying assets which could be mortgages or other obligations.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('Convertible', 'Identifies a debt instrument that can be converted into common shares.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('HolderConvertible', 'Identifies a debt instrument that can be converted primarily at the election of the holder into common shares of the Issuer.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('HolderExchangeable', 'Identifies a debt instrument that can be converted primarily at the election of the holder into common shares of a party other than the Issuer.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('IssuerConvertible', 'Identifies a debt instrument that can be converted at the election of the Issuer into common shares of the Issuer.  Also known as reverse convertible.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('IssuerExchangeable', 'Identifies a debt instrument that can be converted at the election of the Issuer into common shares of a party other than the Issuer.  Also known as reverse exchangeable.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('RegCap', 'Identifies a debt instrument as one issued by financial institutions to count towards regulatory capital, including term and perpetual subordinated debt, contingently convertible and others.  Excludes preferred share capital.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('Structured', 'Identifies a debt instrument athat has non-standard interest or principal features, with full recourse to the issuer.');
INSERT INTO cdm_base_staticdata_asset_common.DebtClassEnum (DebtClassEnum, Description) VALUES ('Vanilla', 'Identifies a debt instrument that has a periodic coupon, a defined maturity, and is not backed by any specific asset. The seniority and the structure of the income and principal payments can optionally be defined in DebtType.DebtEconomics.');
