INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('CorporateAction', 'A cash flow corresponding to a corporate action event.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('Coupon', 'A cash flow corresponding to the periodic accrued interests.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('CreditEvent', 'A cashflow resulting from a credit event.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('DividendReturn', 'A cash flow corresponding to the synthetic dividend of an equity underlier asset traded through a derivative instrument.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('Exercise', 'A cash flow associated with an exercise lifecycle event.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('FixedRateReturn', 'A cash flow corresponding to the return of the fixed interest rate portion of a derivative instrument that has different types of underlying assets, such as a total return swap.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('FloatingRateReturn', 'A cash flow corresponding to the return of the floating interest rate portion of a derivative instrument that has different types of underlying assets, such as a total return swap.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('FractionalAmount', 'A cash flow corresponding to the compensation for missing assets due to the rounding of digits in the original number of assets to be delivered as per payout calculation.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('InterestReturn', 'A cash flow corresponding to the return of the interest rate portion of a derivative instrument that has different types of underlying assets, such as a total return swap.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('NetInterest', 'Net interest across payout components. Applicable to products such as interest rate swaps.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('Performance', 'A cash flow corresponding to a performance return.  The settlementOrigin attribute on the Transfer should point to the relevant Payout defining the performance calculation.');
INSERT INTO cdm_product_common_settlement.ScheduledTransferEnum (ScheduledTransferEnum, Description) VALUES ('PrincipalPayment', 'A cashflow which amount typically corresponds to the notional amount of the contract for various business reasons e.g. PhysicalSettlement, PrincipalExchange etc. else to a portion of the notional amount interim payments e.g. for the purpose of resetting the Notional Amount of a Cross Currency Swap variying leg, as part of a final Principal Exchange related to a Non-Deliverable currency leg, etc.');
