INSERT INTO cdm_observable_asset_calculatedrate.InflationCalculationMethodEnum (InflationCalculationMethodEnum, Description) VALUES ('Ratio', '(Inflation Index Final / Inflation Index Base). Inflation Index Final is inflation index for Reference Month that is the Lag number of months prior to Payment Date (subject to interpolation). Inflation Index Base subject to the Calculation Style. Used in inflation asset swaps to calculate the inflation coupons and principal exchange.');
INSERT INTO cdm_observable_asset_calculatedrate.InflationCalculationMethodEnum (InflationCalculationMethodEnum, Description) VALUES ('Return', '(Inflation Index Final / Inflation Index Base -1). Inflation Index Final is the inflation index for Reference Month that is the Lag number of months prior to Payment Date (subject to interp). Inflation Index Base subject to the Calculation Style. Used in market standard ZC Inflation swaps.');
INSERT INTO cdm_observable_asset_calculatedrate.InflationCalculationMethodEnum (InflationCalculationMethodEnum, Description) VALUES ('Spread', 'Inflation Index Final - Inflation Index Base). Inflation Index Final is Index for Ref month the Lag months prior to Payment Date (subject to interp). Inflation Index Base subject to the Calculation Style. Typically used for fixing locks.');
