INSERT INTO cdm_base_staticdata_asset_common.DebtPrincipalEnum (DebtPrincipalEnum, Description) VALUES ('Amortising', 'Denotes that the principal on the debt is paid down regularly, along with its interest expense over the life of the debt instrument.  Includes amortising instruments with a bullet balance repayment at maturity.');
INSERT INTO cdm_base_staticdata_asset_common.DebtPrincipalEnum (DebtPrincipalEnum, Description) VALUES ('Bullet', 'Denotes that the principal is paid all at once on maturity of the debt insrument. Bullet debt instruments cannot be redeemed early by an issuer, which means they are non-callable.');
INSERT INTO cdm_base_staticdata_asset_common.DebtPrincipalEnum (DebtPrincipalEnum, Description) VALUES ('Callable', 'Denotes that the principal on the debt can be repaid early, in whole or in part, at the option of the issuer.');
INSERT INTO cdm_base_staticdata_asset_common.DebtPrincipalEnum (DebtPrincipalEnum, Description) VALUES ('IndexLinked', 'Denotes that the  principal on the debt is calculated with reference to one or more price or other indices (other than inflation rates).');
