INSERT INTO cdm_base_staticdata_asset_common.DebtPrincipalEnum (DebtPrincipalEnum, Description) VALUES ('OtherStructured', 'Denotes that the  principal on the debt is calculated with reference to other underlyings (not being floating interest rates, inflation rates or indices) or with a non-linear relationship to floating interest rates, inflation rates or indices.');
INSERT INTO cdm_base_staticdata_asset_common.DebtPrincipalEnum (DebtPrincipalEnum, Description) VALUES ('PrincipalOnly', 'Denotes a stripped bond representing only the principal component.');
INSERT INTO cdm_base_staticdata_asset_common.DebtPrincipalEnum (DebtPrincipalEnum, Description) VALUES ('Puttable', 'Denotes that the principal on the debt can be repaid early, in whole or in part, at the option of the holder.');
