INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('EOM', 'Rolls on month end dates irrespective of the length of the month and the previous roll day.');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('FRI', 'Rolling weekly on a Friday');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('FRN', 'Roll days are determined according to the FRN Convention or Euro-dollar Convention as described in ISDA 2000 definitions.');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('IMM', 'IMM Settlement Dates. The third Wednesday of the (delivery) month.');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('IMMAUD', 'The last trading day of the Sydney Futures Exchange 90 Day Bank Accepted Bills Futures contract (see http://www.sfe.com.au/content/sfe/trading/con_specs.pdf). One Sydney business day preceding the second Friday of the relevant settlement.');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('IMMCAD', 'The last trading day/expiration day of the Canadian Derivatives Exchange (Bourse de Montreal Inc) Three-month Canadian Bankers'' Acceptance Futures (Ticker Symbol BAX). The second London banking day prior to the third Wednesday of the contract month. If the determined day is a Bourse or bank holiday in Montreal or Toronto, the last trading day shall be the previous bank business day. Per Canadian Derivatives Exchange BAX contract specification.');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('IMMNZD', 'The last trading day of the Sydney Futures Exchange NZ 90 Day Bank Bill Futures contract (see http://www.sfe.com.au/content/sfe/trading/con_specs.pdf). The first Wednesday after the ninth day of the relevant settlement month.');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('MON', 'Rolling weekly on a Monday.');
