INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('SUN', 'Rolling weekly on a Sunday');
INSERT INTO cdm_base_datetime.RollConventionEnum (RollConventionEnum, Description) VALUES ('TBILL', '13-week and 26-week U.S. Treasury Bill Auction Dates. Each Monday except for U.S. (New York) holidays when it will occur on a Tuesday.');
