INSERT INTO cdm_observable_event.ShareExtraordinaryEventEnum (ShareExtraordinaryEventEnum, Description) VALUES ('AlternativeObligation', 'The trade continues such that the underlying now consists of the New Shares and/or the Other Consideration, if any, and the proceeds of any redemption, if any, that the holder of the underlying Shares would have been entitled to.');
INSERT INTO cdm_observable_event.ShareExtraordinaryEventEnum (ShareExtraordinaryEventEnum, Description) VALUES ('CalculationAgent', 'The Calculation Agent will determine what adjustment is required to offset any change to the economics of the trade. If the Calculation Agent cannot achieve this, the trade goes to Cancellation and Payment with the Calculation Agent deciding on the value of the cancellation fee. Adjustments may not be made to account solely for changes in volatility, expected dividends, stock loan rate or liquidity.');
INSERT INTO cdm_observable_event.ShareExtraordinaryEventEnum (ShareExtraordinaryEventEnum, Description) VALUES ('CancellationAndPayment', 'The trade is cancelled and a cancellation fee will be paid by one party to the other.');
INSERT INTO cdm_observable_event.ShareExtraordinaryEventEnum (ShareExtraordinaryEventEnum, Description) VALUES ('Component', 'If this is a Share-for-Combined merger event (Shares are replaced with New Shares and Other Consideration), then different treatment can be applied to each component if the parties have specified this.');
INSERT INTO cdm_observable_event.ShareExtraordinaryEventEnum (ShareExtraordinaryEventEnum, Description) VALUES ('ModifiedCalculationAgent', 'The Calculation Agent will determine what adjustment is required to offset any change to the economics of the trade. If the Calculation Agent cannot achieve this, the trade goes to Cancellation and Payment with the Calculation Agent deciding on the value of the cancellation fee. Adjustments to account for changes in volatility, expected dividends, stock loan rate or liquidity are allowed.');
INSERT INTO cdm_observable_event.ShareExtraordinaryEventEnum (ShareExtraordinaryEventEnum, Description) VALUES ('OptionsExchange', 'The trade will be adjusted by the Calculation Agent in accordance with the adjustments made by any exchange on which options on the underlying are listed.');
INSERT INTO cdm_observable_event.ShareExtraordinaryEventEnum (ShareExtraordinaryEventEnum, Description) VALUES ('PartialCancellationAndPayment', 'Applies to Basket Transactions. The portion of the Basket made up by the affected Share will be cancelled and a cancellation fee will be paid from one party to the other. The remainder of the trade continues.');
INSERT INTO cdm_product_collateral.DeliveryAmountElectionEnum (DeliveryAmountElectionEnum, Description) VALUES ('LastAndAnyLocalBusinessDay', 'The delivery includes both `Transfer on last Local Business Day` and `Transfer a Delivery Amount (IM) consisting of cash on any Local Business Day.`');
INSERT INTO cdm_product_collateral.DeliveryAmountElectionEnum (DeliveryAmountElectionEnum, Description) VALUES ('LastLocalBusinessDay', 'The delivery only includes `Transfer on last Local Business Day.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('CFI', 'Represents the ISO 10962 Classification of Financial Instruments code.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('EMIR', 'Represents the EMIR Article 9 Asset Definition Identifier code.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('EU_EMIR_EligibleCollateralAssetClass', 'Identifies European Union Eligible Collateral Assets classification categories based on EMIR Uncleared Margin Rules.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('ICAD', 'Represents the ISDA Collateral Asset Definition Idenifier code.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('ISDA', 'Represents the ISDA product taxonomy.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('Other', 'Denotes a user-specific scheme or taxonomy or other external sources not listed here.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('UK_EMIR_EligibleCollateralAssetClass', 'Identifies United Kingdom Eligible Collateral Assets classification categories based on UK Onshored EMIR Uncleared Margin Rules Eligible Collateral asset classes for both initial margin (IM) and variation margin (VM) posted and collected between specified entities.Please note: UK EMIR regulation will detail which eligible collateral assets classes apply to each type of entity pairing (counterparty) and which apply to posting of IM and VM.');
INSERT INTO cdm_base_staticdata_asset_common.TaxonomySourceEnum (TaxonomySourceEnum, Description) VALUES ('US_CFTC_PR_EligibleCollateralAssetClass', 'Identifies US Eligible Collateral Assets classification categories based on Uncleared Margin Rules published by the CFTC and the US Prudential Regulator. Note: While the same basic categories exist in the CFTC and US Prudential Regulators margin rules, the precise definitions or application of those rules could differ between the two rules.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ARS.BNAR/ARS01', 'The Spot Rate for a Rate Calculation Date will be the Argentine Peso/U.S. Dollar Specified Rate, expressed as the amount of Argentine Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Buenos Aires and New York) which appears on the Reuters Screen BNAR Page at the close of business in Buenos Aires on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ARS.EMTA.INDICATIVE.SURVEY.RATE/ARS04', 'The Spot Rate for a Rate Calculation Date will be the Argentine Peso/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Argentine Pesos per one U.S. Dollar, for settlement on the same day, as published on EMTA''s web site (www.emta.org) at approximately 1:00 p.m. (Buenos Aires time), or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate shall be calculated by EMTA (or a service provider EMTA may select in its sole discretion) pursuant to the EMTA ARS Indicative Survey Methodology (which means a methodology, dated as of January 2, 2003, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Argentine Peso/U.S. Dollar markets for the purpose of determining the EMTA ARS Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ARS.EMTA.INDUSTRY.SURVEY.RATE/ARS03', 'The Spot Rate for a Rate Calculation Date will be the Argentine Peso/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Argentine Pesos per one U.S. Dollar, for settlement on the same day, as published on EMTA''s web site (www.emta.org) at approximately 1:00 p.m. (Buenos Aires time), or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate shall be calculated by EMTA (or a service provider EMTA may select in its sole discretion) pursuant to the EMTA ARS Industry Survey Methodology (which means a methodology, dated as of January 2, 2003, as amended from time to time, for a centralized industry-wide survey of financial institutions in Buenos Aires that are active participants in the Argentine Peso/U.S. Dollar spot markets for the purpose of determining the EMTA ARS Industry Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ARS.MAE/ARS05', 'The Spot Rate for a Rate Calculation Date will be the volume weighted average Argentine Peso/U.S. Dollar Rate of all trades executed in the electronic market for a Rate Calculation Day expressed as the amount of Argentine Pesos per one U.S. Dollar, for settlement on the same day, reported by the Mercado Abierto Electronico (the ''MAE'') at approximately 3:00 pm, Buenos Aires time, and published on the FOREX-MAE Page as the ''PPN'' rate (''Promedio Ponderado Noticiado'') on www.mae.com.ar on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ARS.OFFICIAL.RATE/ARS02', 'The Spot Rate for a Rate Calculation Date will be the Argentine Peso/U.S. Dollar offered rate for U.S. Dollars, expressed as the amount of Argentine Pesos per one U.S. Dollar, for settlement on the same day quoted by Banco de la Nacion (in accordance with the Convertibility Law of March 27, 1991 and Regulatory Decree No. 529/91 of April 1, 1991, as may be amended from time to time) for that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.BRBY/BRL01', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar Specified Rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) which appears on the Reuters Screen BRBY Page under the caption ''INTBK FLTING (LAST)'' at approximately 11:00 a.m., Sao Paulo time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.EMTA.INDICATIVE.SURVEY.RATE/BRL13', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days, as published on EMTA''s web site (www.emta.org) at approximately 12:00 p.m. (Sao Paulo time), or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate shall be calculated by EMTA (or a service provider EMTA may select in its sole discretion) pursuant to the EMTA BRL Indicative Survey Methodology (which means a methodology, dated as of March 1, 2004, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Brazilian Real/U.S. Dollar markets for the purpose of determining the EMTA BRL Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.EMTA.INDUSTRY.SURVEY.RATE/BRL12', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days, as published on EMTA''s web site (www.emta.org) at approximately 3:45 p.m. (Sao Paulo time), or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate shall be calculated by EMTA (or a service provider EMTA may select in its sole discretion) pursuant to the EMTA BRL Industry Survey Methodology (which means a methodology, dated as of March 1, 2004, as amended from time to time, for a centralized industry-wide survey of financial institutions in Brazil that are active participants in the Brazilian Real/U.S. Dollar spot markets for the purpose of determining the EMTA BRL Industry Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.OFFICIAL.RATE/BRL02', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar Specified Rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) reported by the Banco Central do Brasil in the ''Diario Oficial da Uniao'' on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.PCOT-COMMERCIAL/BRL03', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar commercial rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) reported by the Banco Central do Brasil on SISBACEN Data System under transaction code PCOT- 390, Option 3, at the Specified Time, if any, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.PCOT-FLOATING/BRL04', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar floating rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) reported by the Banco Central do Brasil on SISBACEN Data System under transaction code PCOT- 390, Option 3, at the Specified Time, if any, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.PTAX/BRL09', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar offered rate for U.S. Dollars, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days reported by the Banco Central do Brasil on SISBACEN Data System under transaction code PTAX-800 (''Consulta de Cambio'' or Exchange Rate Inquiry), Option 5 (''Cotacoes para Contabilidade'' or ''Rates for Accounting Purposes'') by approximately 6:00 p.m., Sao Paulo time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.PTAX-COMMERCIAL.BRFR/BRL06', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar commercial rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) reported by the Banco Central do Brasil which appears on the Reuters Screen BRFR Page at PTAX-800 as of 11:00 a.m., Sao Paulo time, on the first Business Day following that Rate Calculation Date. 23');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.PTAX-COMMERCIAL/BRL05', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar commercial rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) reported by the Banco Central do Brasil on SISBACEN Data System under transaction code PTAX- 800 (''Consultas de Cambio'' or Exchange Rate Inquiry), Option 5 (''Cotacoes para Contabilidad'' or Rates for Accounting Purposes) market type ''L'' (corresponding to U.S. Dollars traded in the foreign exchange market segment officially denominated ''Livre'' and commonly known as ''Comercial'') as of 7:30 p.m., Sao Paulo time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.PTAX-FLOATING.BRFR/BRL08', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar floating rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) reported by the Banco Central do Brasil on the SISBACEN Data System which appears on the Reuters Screen BRFR Page at PTAX-800 as of 11:00 a.m., Sao Paulo time, on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('BRL.PTAX-FLOATING/BRL07', 'The Spot Rate for a Rate Calculation Date will be the Brazilian Real/U.S. Dollar floating rate, expressed as the amount of Brazilian Reais per one U.S. Dollar, for settlement in two Business Days (where such days are Business Days in both Sao Paulo and New York) reported by the Banco Central do Brasil on SISBACEN Data System under transaction code PTAX- 800 (''Consultas de Cambio'' or Exchange Rate Inquiry), Option 5 (''Cotacoes para Contabilidad'' or Rates for Accounting Purposes) market type ''F'' (corresponding to U.S. Dollars traded in the foreign exchange market segment officially denominated ''Flutuante'') as of 7:30 p.m., Sao Paulo time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.BCCH/CLP01', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar observado rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) reported by the Banco Central de Chile which appears on the Reuters Screen BCCH Page under the caption ''OBSERVADO'' at 10:00 a.m., Santiago time, on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.CHILD-INFORMAL/CLP02', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar informal rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) of the informal exchange market which appears on the Reuters Screen CHILD Page at the Specified Time, if any, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.CHILD-INTERBANK/CLP03', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar interbank rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) reported by the Banco Central de Chile for the formal exchange market which appears on the Reuters Screen CHILD Page at the Specified Time, if any, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.CHILD-OBSERVADO/CLP04', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar observado rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) reported by the Banco Central de Chile which appears on the Reuters Screen CHILD Page on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.CHILG-INFORMAL/CLP05', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar informal rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) of the informal exchange market which appears on the Reuters Screen CHILG Page at the Specified Time, if any, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.CHILG-INTERBANK/CLP06', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar interbank rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) reported by the Banco Central de Chile for the formal exchange market which appears on the Reuters Screen CHILG Page at the Specified Time, if any, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.CHILG-OBSERVADO/CLP07', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar observado rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) reported by the Banco Central de Chile which appears on the Reuters Screen CHILG Page under ''OBSERVADO'' at the Specified Time, if any, on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.DOLAR.OBS/CLP10', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar ''observado'' rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement in one Business Day reported by the Banco Central de Chile (www.bcentral.cl) as the ''Dolar Observado'' (Dollar Observado) rate by not later than 10:30 a.m., Santiago time, on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.EMTA.INDICATIVE.SURVEY.RATE/CLP11', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day, as published on EMTA''s web site (www.emta.org) at approximately 11:00 a.m., Santiago time, or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate shall be calculated by EMTA (or a service provider EMTA may select in its sole discretion) pursuant to the EMTA CLP Indicative Survey Methodology (which means a methodology, dated as of August 1, 2006, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Chilean Peso/U.S. Dollar markets for the purpose of determining the EMTA CLP Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.OFFICIAL.RATE/CLP08', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar Specified Rate, expressed as the amount of Chilean Pesos per one U.S. Dollar (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York), calculated in accordance with Title I, Chapter 1 Number 6 of the Compendium of International Exchange Norms of the Banco Central de Chile and published by the Banco Central de Chile at the Specified Time, if any, on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CLP.TELERATE.38942/CLP09', 'The Spot Rate for a Rate Calculation Date will be the Chilean Peso/U.S. Dollar observado rate, expressed as the amount of Chilean Pesos per one U.S. Dollar, for settlement on the same day (or, if such day is not a Business Day in New York, for settlement on the first succeeding day that is a Business Day in both Santiago and New York) reported by the Banco Central de Chile which appears on the Telerate Page 38942 opposite the caption ''Observado'' at the Specified Time, if any, on the first Business Day following the Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CNY.SAEC/CNY01', 'The Spot Rate for a Rate Calculation Date will be the Chinese Renminbi/U.S. Dollar official fixing rate, expressed as the amount of Chinese Renminbi per one U.S. Dollar, for settlement in two Business Days reported by the People''s Bank of China, Beijing, People''s Republic of China, which appears on the Reuters Screen ''SAEC'' Page opposite the symbol ''USDCNY='' at approximately 9:15 a.m., Beijing time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CNY.SFEMC.INDICATIVE.SURVEY.RATE/CNY02', 'The Spot Rate for a Rate Calculation Date will be the Chinese Renminbi/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Chinese Renminbi per one U.S. Dollar, for settlement in two Business Days, as published on SFEMC''s website (www.sfemc.org) at approximately 3:30 p.m. (Singapore time), or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate will be calculated by SFEMC (or a service provider SFEMC may select in its sole discretion) pursuant to the SFEMC CNY Indicative Survey Methodology (which means a methodology, dated as of December 1, 2004, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Chinese Renminbi/U.S. Dollar markets for the purpose of determining the SFEMC CNY Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('COP.CO/COL03/COP01', 'The Spot Rate for a Rate Calculation Date will be the Colombian Peso/U.S. Dollar fixing rate, expressed as the amount of Colombian Pesos per one U.S. Dollar, for settlement on the same day (unless such day is not a Business Day in New York, then for settlement on the first succeeding day that is a Business Day in Bogota and New York) reported by the Colombian Banking Superintendency which appears on the Reuters Screen CO/COL03 Page opposite the caption ''TRCM'' (''Tasa de Cierre Representative del Mercado'' or closing market price) at 12:00 noon, Bogota time, on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('COP.EMTA.INDICATIVE.SURVEY.RATE/COP03', 'The Spot Rate for a Rate Calculation Date will be the Colombian Peso/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Colombian Pesos per one U.S. Dollar, for settlement on the same day, as published on EMTA''s web site (www.emta.org) at approximately 11:30 a.m., Bogota time, or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate shall be calculated by EMTA (or a service provider EMTA may select in its sole discretion) pursuant to the EMTA COP Indicative Survey Methodology (which means a methodology, dated as of August 1, 2006, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Colombian Peso/U.S. Dollar markets for the purpose of determining the EMTA COP Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('COP.TRM/COP02', 'The Spot Rate for a Rate Calculation Date will be the Colombian Peso/U.S. Dollar fixing rate, expressed as the amount of Colombian Pesos per one U.S. Dollar, for settlement on the same day reported by the Colombian Financial Superintendency (www.banrep.gov.co) as the ''Tasa Representativa del Mercado (TRM)'' (also referred to as the ''Tasa de Cambio Representativa del Mercado'' (TCRM)) by not later than 10:30 a.m., Bogota time, on the first Business Day following that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CURRENCY-IMPLIED.RATE.(ADR)/CURA1', 'the Spot Rate for a Rate Calculation Date will be the Reference Currency/U.S. Dollar exchange rate, expressed as the amount of Reference Currency per one U.S. Dollar, determined on the basis of quotations provided by Reference Dealers on that Rate Calculation Date of that day''s price of a Specified Company''s American Depositary Receipt or American Depositary Receipts (the ''ADR'' or ''ADRs'', as appropriate) and the price of the local share or shares of such Specified Company of the same type and in the same quantity represented by such ADR or ADRs, as the case may be (the ''Share'' or ''Shares'', as appropriate). The Calculation Agent will request each of the Reference Dealers to provide a firm quotation of (A) in the case where one ADR represents less than one Share, its bid and offer price (in the Reference Currency) for one Share and its bid and offer price (in U.S. Dollars) for the number of ADRs which represent such Share and (B) in all other cases, its bid and offer price (in the Reference Currency) for the Share or Shares, as the case may be, and its bid and offer price (in U.S. Dollars) for one ADR. If one or more quotations are provided, the rate for a Rate Calculation Date will equal the ratio of (1) the arithmetic mean of the midpoint of the bid and offer prices quoted in the Reference Currency by each Reference Dealer for such Share or Shares, as the case may be, and (2) the arithmetic mean of the midpoint of the bid and offer prices quoted in U.S. Dollars by each Reference Dealer for such ADR or ADRs, as the case may be, subject to an adjustment, if any, by the Calculation Agent to reduce the effect of momentary disparities in the prices of the Share or Shares and the ADR or ADRs, as appropriate. The quotations used to determine the Spot Rate for a Rate Calculation Date will be determined in each case at the Specified Time on the Rate Calculation Date or, if no such time is specified, the time chosen by the Calculation Agent.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CURRENCY-IMPLIED.RATE.(LOCAL.ASSET)/CURA2', 'The Spot Rate for a Rate Calculation Date will be the Reference Currency/Settlement Currency exchange rate, expressed as the amount of Reference Currency per one unit of Settlement Currency, determined on the basis of quotations provided by Reference Dealers on that Rate Calculation Date for that day''s price of Local Assets. The Calculation Agent will request each of the Reference Dealers to provide a firm quotation of its bid and offer price (in both the Reference Currency and the Settlement Currency) for an amount of Local Assets whose face value equals the Specified Amount. If one or more quotations are provided, the rate for a Rate Calculation Date will equal the ratio of (A) the arithmetic mean of the midpoint of the bid and offer prices quoted in the Reference Currency by each Reference Dealer for such Local Assets and (B) the arithmetic mean of the midpoint of the bid and offer prices quoted in the Settlement Currency by each Reference Dealer for such Local Assets. The quotations used to determine the Spot Rate for a Rate Calculation Date will be determined in each case at the Specified Time on the Rate Calculation Date or, if no such time is specified, the time chosen by the Calculation Agent.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CURRENCY-MUTUAL.AGREEMENT/CURA3', 'The Spot Rate for a Rate Calculation Date will be the Reference Currency/Settlement Currency Specified Rate, expressed as the amount of the Reference Currency per one unit of Settlement Currency, for settlement on the Settlement Date agreed upon by the parties on or prior to that Rate Calculation Date (or, if different, the day on which rates for that date would, in the ordinary course, be published or announced).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CURRENCY-REFERENCE.DEALERS/CURA4', 'The Spot Rate for a Rate Calculation Date will be determined on the basis of quotations provided by Reference Dealers on that Rate Calculation Date of that day''s Specified Rate, expressed as the amount of Reference Currency per one unit of Settlement Currency, for settlement on the Settlement Date. The Calculation Agent will request the Specified Office of each of the Reference Dealers to provide a firm quotation of its Specified Rate for a transaction where the amount of Reference Currency equals the Specified Amount. If four quotations are provided, the rate for a Rate Calculation Date will be the arithmetic mean of the Specified Rates, without regard to the Specified Rates having the highest and lowest value. If exactly three quotations are provided, the rate for a Rate Calculation Date will be the Specified Rate provided by the Reference Dealer that remains after disregarding the Specified Rates having the highest and lowest values. For this purpose, if more than one quotation has the same highest value or lowest value, then the Specified Rate of one of such quotations shall be disregarded. If exactly two quotations are provided, the rate for a Rate Calculation Date will be the arithmetic mean of the Specified Rates. If only one quotation is provided, the rate for a Rate Calculation Date will be the Specified Rate quoted by that Reference Dealer. The quotations used to determine the Spot Rate for a Rate Calculation Date will be determined in each case at the Specified Time on that Rate Calculation Date or, if no such time is specified, the time chosen by the Calculation Agent.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('CURRENCY-WHOLESALE.MARKET/CURA5', 'The Spot Rate for a Rate Calculation Date will be determined by the Calculation Agent on the basis of that day''s Specified Rate, expressed as the amount of Reference Currency per one unit of Settlement Currency, in a legal and customary wholesale market in which there is no, or minimal, Governmental Authority controls or interference, except as a participant in such market.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ECS.DNRP/ECS01', 'The Spot Rate for a Rate Calculation Date will be the Ecuadorian Sucre/U.S. Dollar Specified Rate, expressed as the amount of Ecuadorian Sucres per one U.S. Dollar, for settlement in one Business Day (where such day is a Business Day in Guayaquil and New York) which appears on Reuters Screen DNRP Page at 12:00 noon, Guayaquil time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('IDR.ABS/IDR01', 'The Spot Rate for a Rate Calculation Date will be the Indonesian Rupiah/U.S. Dollar spot rate at 11:00 a.m., Singapore time, expressed as the amount of Indonesian Rupiah per one U.S. Dollar, for settlement in two Business Days, reported by the Association of Banks in Singapore which appears on the Telerate Page 50157 to the right of the caption ''Spot'' under the column ''IDR'' at approximately 11:30 a.m., Singapore time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('IDR.JISDOR/IDR04', 'The Spot Rate for a Rate Calculation Date will be the Indonesian Rupiah/U.S. Dollar weighted average spot rate in the interbank market based on traded IDR/USD spot foreign exchange transactions during a specified time period which are captured on a real time basis, expressed as the amount of Indonesian Rupiah per one U.S. Dollar, for settlement in two Business Days, published by Bank Indonesia at approximately 10:00 a.m., Jakarta time, on that Rate Calculation Date as the Jakarta Interbank Spot Dollar Rate USD - IDR on Bank Indonesia''s website or otherwise made available by Bank Indonesia (or its successor as administrator).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('IDR.SFEMC.INDICATIVE.SURVEY.RATE/IDR02', 'The Spot Rate for a Rate Calculation Date will be the Indonesian Rupiah/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Indonesian Rupiah per one U.S. Dollar, for settlement in two Business Days, as published on SFEMC''s website (www.sfemc.org) at approximately 3:30 p.m., Singapore time, or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate will be calculated by SFEMC (or a service provider SFEMC may select in its sole discretion) pursuant to the SFEMC IDR Indicative Survey Methodology (which means a methodology, dated as of December 1, 2004, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Indonesian Rupiah/U.S. Dollar markets for the purpose of determining the SFEMC IDR Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('IDR.VWAP/IDR03', 'The Spot Rate for a Rate Calculation Date will be the Indonesian Rupiah/U.S. Dollar implied spot rate expressed as the amount of Indonesian Rupiah per one U.S. Dollar, for settlement in two Business Days, reported by ABS Benchmarks Administration Co Pte. Ltd. (or its successor as administrator or sponsor of that rate), which appears on Thomson Reuters Screen ABSFIX01 Page at approximately 11:30 a.m., Singapore time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ILS.BOIJ/ILS01', 'The Spot Rate for a Rate Calculation Date will be the Israeli Shekel/U.S. Dollar Specified Rate, expressed as the amount of Israeli Shekels per one U.S. Dollar, for settlement in two Business Days which appears on the Reuters Screen BOIJ Page as of 1:00 p.m., Tel Aviv time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('ILS.FXIL/ILS02', 'The Spot Rate for a Rate Calculation Date will be the Israeli Shekel/U.S. Dollar Specified Rate, expressed as the amount of Israeli Shekels per one U.S. Dollar, for settlement in two Business Days which appears on the Reuters Screen FXIL Page as of 1:00 p.m., Tel Aviv time, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('INR.FBIL/INR01', 'The Spot Rate for a Rate Calculation Date will be the Indian Rupee/U.S. Dollar reference rate, expressed as the amount of Indian Rupee per one U.S. Dollar, for settlement in two Business Days, reported by Financial Benchmarks India Pvt. Ltd. (www.fbil.org.in) at approximately 1:30 p.m., Mumbai time, or as soon thereafter as practicable, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('INR.RBIB/INR01', 'The Spot Rate for a Rate Calculation Date will be the Indian Rupee/U.S. Dollar reference rate, expressed as the amount of Indian Rupee per one U.S. Dollar, for settlement in two Business Days reported by the Reserve Bank of India which appears on the Reuters Screen RBIB Page at approximately 12:30 p.m., Mumbai time, or as soon thereafter as practicable, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('INR.SFEMC.INDICATIVE.SURVEY.RATE/INR02', 'The Spot Rate for a Rate Calculation Date will be the Indian Rupee/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Indian Rupee per one U.S. Dollar, for settlement in two Business Days, as published on SFEMC''s website (www.sfemc.org) at approximately 3:30 p.m. (Singapore time), or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate will be calculated by SFEMC (or a service provider SFEMC may select in its sole discretion) pursuant to the SFEMC INR Indicative Survey Methodology (which means a methodology, dated as of December 1, 2004, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Indian Rupee/U.S. Dollar markets for the purpose of determining the SFEMC INR Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('KRW.KEBEY/KRW01', 'The Spot Rate for a Rate Calculation Date will be the Korean Won/U.S. Dollar Specified Rate, expressed as the amount of Korean Won per one U.S. Dollar, for settlement in two Business Days which appears on the Reuters Screen KEBEY Page at the Specified Time, if any, on that Rate Calculation Date.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('KRW.KFTC18/KRW02', 'The Spot Rate for a Rate Calculation Date will be the Korean Won/U.S. Dollar market average rate, expressed as the amount of Korean Won per one U.S. Dollar, for settlement in two Business Days reported by the Korea Financial Telecommunications and Clearing Corporation which appears on the Reuters Screen KFTC18 Page to the right of the caption ''USD Today'' that is available at approximately 3:30 p.m., Seoul time, on the Rate Calculation Date or as soon thereafter as practicable.');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('KRW.SFEMC.INDICATIVE.SURVEY.RATE/KRW04', 'The Spot Rate for a Rate Calculation Date will be the Korean Won/U.S. Dollar Specified Rate for U.S. Dollars, expressed as the amount of Korean Won per one U.S. Dollar, for settlement in two Business Days, as published on SFEMC''s website (www.sfemc.org) at approximately 3:30 p.m., Singapore time, or as soon thereafter as practicable, on such Rate Calculation Date. The Spot Rate will be calculated by SFEMC (or a service provider SFEMC may select in its sole discretion) pursuant to the SFEMC KRW Indicative Survey Methodology (which means a methodology, dated as of December 1, 2004, as amended from time to time, for a centralized industry-wide survey of financial institutions that are active participants in the Korean Won/U.S. Dollar markets for the purpose of determining the SFEMC KRW Indicative Survey Rate).');
INSERT INTO cdm_observable_asset.SettlementRateOptionEnum (SettlementRateOptionEnum, Description) VALUES ('KRW.TELERATE.45644/KRW03', 'The Spot Rate for a Rate Calculation Date will be the Korean Won/U.S. Dollar market average rate, expressed as the amount of Korean Won per one U.S. Dollar, for settlement in two Business Days reported by the Korea Financial Telecommunications and Clearing Corporation which appears on Telerate Page 45644 to the right of the caption ''USD Today'' that is available at approximately 3:30 p.m., Seoul time, on the Rate Calculation Date or as soon thereafter as practicable.');
