INSERT INTO cdm_base_math.AveragingWeightingMethodEnum (AveragingWeightingMethodEnum, Description) VALUES ('Unweighted', 'The arithmetic mean of the relevant rates for each reset date.');
INSERT INTO cdm_base_math.AveragingWeightingMethodEnum (AveragingWeightingMethodEnum, Description) VALUES ('Weighted', 'The arithmetic mean of the relevant rates in effect for each day in a calculation period calculated by multiplying each relevant rate by the number of days such relevant rate is in effect, determining the sum of such products and dividing such sum by the number of days in the calculation period.');
INSERT INTO cdm_product_common_settlement.CashSettlementMethodEnum (CashSettlementMethodEnum, Description) VALUES ('CashPriceAlternateMethod', 'An ISDA defined cash settlement method used for the determination of the applicable cash settlement amount. The method is defined in the 2006 ISDA Definitions, Section 18.3. Cash Settlement Methods, paragraph (b).');
