INSERT INTO cdm_product_common_settlement.CashSettlementMethodEnum (CashSettlementMethodEnum, Description) VALUES ('CollateralizedCashPriceMethod', 'An ISDA defined cash settlement method (yield curve) used for the determination of the applicable cash settlement amount. The method is defined in the 2006 ISDA Definitions, Section 18.3. Cash Settlement Methods, paragraph (g) (published in Supplement number 28). The method is defined in the 2021 ISDA Definitions, section 18.2.6.');
