INSERT INTO cdm_event_position.PositionStatusEnum (PositionStatusEnum, Description) VALUES ('Cancelled', 'The position has been cancelled, in case of a cancellation event following an execution.');
INSERT INTO cdm_event_position.PositionStatusEnum (PositionStatusEnum, Description) VALUES ('Closed', 'The position has been closed, in case of a termination event.');
INSERT INTO cdm_event_position.PositionStatusEnum (PositionStatusEnum, Description) VALUES ('Executed', 'The position has been executed, which is the point at which risk has been transferred.');
