INSERT INTO cdm_product_template.CallingPartyEnum (CallingPartyEnum, Description) VALUES ('Either', 'Either, Buyer or Seller to the repo transaction.');
INSERT INTO cdm_product_template.CallingPartyEnum (CallingPartyEnum, Description) VALUES ('InitialBuyer', 'Initial buyer to the repo transaction.');
