INSERT INTO cdm_event_common.ExecutionTypeEnum (ExecutionTypeEnum, Description) VALUES ('Electronic', 'Execution via electronic execution facility, derivatives contract market, or other electronic message such as an instant message.');
INSERT INTO cdm_event_common.ExecutionTypeEnum (ExecutionTypeEnum, Description) VALUES ('OffFacility', 'Bilateral execution between counterparties not pursuant to the rules of a SEF or DCM.');
INSERT INTO cdm_event_common.ExecutionTypeEnum (ExecutionTypeEnum, Description) VALUES ('OnVenue', 'Execution via a platform that may or may not be covered by a regulatory defintion. OnVenue is intended to distinguish trades executed on a trading platform from those executed via phone, email or messaging apps. The role and details of the venue are included in the party attribute of the trade. The general rule is that if the parties utilitzed the services of the platform to execute the trade then it would be considered OnVenue.');
INSERT INTO cdm_base_math.RoundingDirectionEnum (RoundingDirectionEnum, Description) VALUES ('Down', 'A fractional number will be rounded down to the specified number of decimal places (the precision). For example, 5.29 and 5.25 rounded down to 1 decimal place are 5.2 and 5.2 respectively.');
INSERT INTO cdm_base_math.RoundingDirectionEnum (RoundingDirectionEnum, Description) VALUES ('Nearest', 'A fractional number will be rounded either up or down to the specified number of decimal places (the precision) depending on its value. For example, 5.24 would be rounded down to 5.2 and 5.25 would be rounded up to 5.3 if a precision of 1 decimal place were specified.');
INSERT INTO cdm_base_math.RoundingDirectionEnum (RoundingDirectionEnum, Description) VALUES ('Up', 'A fractional number will be rounded up to the specified number of decimal places (the precision). For example, 5.21 and 5.25 rounded up to 1 decimal place are 5.3 and 5.3 respectively.');
INSERT INTO cdm_product_asset.FPVFinalPriceElectionFallbackEnum (FPVFinalPriceElectionFallbackEnum, Description) VALUES ('FPVClose', 'In respect of the Early Final Valuation Date, the provisions for FPV Close shall apply.');
INSERT INTO cdm_product_asset.FPVFinalPriceElectionFallbackEnum (FPVFinalPriceElectionFallbackEnum, Description) VALUES ('FPVHedgeExecution', 'In respect of the Early Final Valuation Date, the provisions for FPV Hedge Execution shall apply.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('BBGID', 'Published by Bloomberg, the BBGID is a 12-digit alphanumeric randomly generated ID covering active and non-active securities.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('BBGTICKER', 'Published by Bloomberg as a short code to identify publicly trades shares of a particular stock on a specific exchange.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('CUSIP', 'Derived from the Committee on Uniform Security Identification Procedures, CUSIPs are 9-character identifiers that capture an issue’s important differentiating characteristics for issuers and their financial instruments in the U.S. and Canada.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('FIGI', 'Issued under the guidelines of the Object Management Group, the Financial Instrument Global Identifier (FIGI) is a 12 character, alphanumeric, randomly generated ID covering hundreds of millions of active and inactive instruments. The identifier acts as a Uniform Resource Identifier (URI) to link to a set of metadata that uniquely and clearly describes the instrument.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('ISDACRP', 'Issued by the International Swaps Dealers Association as a string representing a Commodity Reference Price used for purposes of determining a relevant price for an underlying commodity in an OTC derivatives contract.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('ISIN', 'Issued by The International Securities Identification Number (ISIN) Organization, the ISIN is a 12-character alpha-numerical code used to uniformly identify a security for trading and settlement purposes. Securities with which ISINs can be used include debt securities, such as notes or bonds as well shares, such as common stock or shares of a fund, options, derivatives, and futures. The ISIN structure is defined in ISO 6166.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('Name', 'The name of the product.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('Other', 'Used when the source is not otherwise in this enumerated list because it is internal or other reasons.  The source can be identified in the scheme which is part of the identifier attribute.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('RIC', 'Issued by Refinitiv (formerly Reuters), the Reuters Instrument Codes(RIC) uniquely identifies financial instruments, including where they are traded.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('SEDOL', 'Assigned by the London Stock Exchange, the Stock Exchange Daily Official List (SEDOL) is a list of security identifiers used in the United Kingdom and Ireland for clearing purposes.  SEDOLs serve as the National Securities Identifying Number for all securities issued in the United Kingdom and are therefore part of the security''s ISIN as well.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('Sicovam', 'Issued by the French Société Interprofessionnelle pour la Compensation des Valeurs Mobilières (SICOVAM) to identify French securities listed on French stock exchanges.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('UPI', 'Assigned by the Derivatives Service Bureau Ltd (DSB), the Unique Product Identifier (UPI) is a unique code to describe an over-the-counter (OTC) derivatives product.  The UPI is used for identifying the product in transaction reporting data.');
INSERT INTO cdm_base_staticdata_asset_common.ProductIdTypeEnum (ProductIdTypeEnum, Description) VALUES ('Wertpapier', 'Issued by the Institute for the Issuance and Administration of Securities in Germany (Securities Information), the Wertpapierkennnummer (WKN, WPKN, WPK or simply Wert) consists of six digits or capital letters (excluding I and O), and no check digit. It is used to identify German securities.');
INSERT INTO cdm_product_common_schedule.StubPeriodTypeEnum (StubPeriodTypeEnum, Description) VALUES ('LongFinal', 'If there is a non regular period remaining it is placed at the end of the stream and combined with the adjacent calculation period to give a long last calculation period.');
INSERT INTO cdm_product_common_schedule.StubPeriodTypeEnum (StubPeriodTypeEnum, Description) VALUES ('LongInitial', 'If there is a non regular period remaining it is placed at the start of the stream and combined with the adjacent calculation period to give a long first calculation period.');
INSERT INTO cdm_product_common_schedule.StubPeriodTypeEnum (StubPeriodTypeEnum, Description) VALUES ('ShortFinal', 'If there is a non regular period remaining it is left shorter than the streams calculation period frequency and placed at the end of the stream.');
INSERT INTO cdm_product_common_schedule.StubPeriodTypeEnum (StubPeriodTypeEnum, Description) VALUES ('ShortInitial', 'If there is a non regular period remaining it is left shorter than the streams calculation period frequency and placed at the start of the stream.');
