INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Accountant', 'Organization responsible for preparing the accounting for the trade.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('AgentLender', 'An agent who lends securities of its principals under stock lending arrangements.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('AllocationAgent', 'The organization responsible for supplying the allocations for a trade to be allocated to multiple accounts/organizations.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ArrangingBroker', 'The organization that arranged the trade, i.e. brought together the counterparties.  Synonyms/Alternatives: Inter-dealer broker, agent.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('BarrierDeterminationAgent', 'The party specified in the related confirmation as Barrier Determination Agent.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('BeneficialOwner', 'The party that lends out securities under stock lending arrangements via an Agent Lender.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Beneficiary', 'Organization that suffers the economic benefit of the trade.  The beneficiary may be distinct from the principal/counterparty - an example occurs when a hedge fund trades via a prime broker; in this case the principal is the prime broker, but the beneficiary is the hedge fund.  This can be represented as a payer/receiver account in the name of the hedge fund, but it is also possible to add the party role of ''Beneficiary'' at the partyTradeInformation level.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('BookingParty', 'The entity for which the organization supporting the trade''s processing has booked/recorded the trade. This is used in non-reporting workflows situations in which the trade doesn''t need to be reported but a firm still wants to specify their own side.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Borrower', 'The party that borrows securities under stock lending arrangements.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Buyer', 'Acquirer of the legal title to the financial instrument. In the case of an option, the buyer is the holder of the option. In the case of a swap or forward, the buyer will be determined by industry best practice.  This does not refer to an investor or investment manager or other organization on what is typically called  the ''Buy side''; for that, see the ''Client'' role. Corresponds to ''Buyer'' as defined in certain regulations such as ESMA MiFID II/MIFIR RTS 22 field 9.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('BuyerDecisionMaker', 'The party or person who, having legal authority to act on behalf of the trade counterparty acting as Buyer as defined in this coding scheme, made the decision to acquire the financial instrument. Corresponds to ''buyer decision maker'' as defined in ESMA''s MIFIR RTS 23 report. This does not refer to the decision maker for what is traditionally called the ''Buy side''; for that, see the ''Client Decision Maker'' role.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Chargor', 'The party that provides credit support under English Law.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ClearingClient', 'An organization that clears trades through a clearing house, via a clearing broker (member of the clearing house) who acts as an agent on its behalf. The term ''client'' refers to the organization''s role in the clearing process in relation to its clearing broker, and not whether it is a price maker or taker in the execution process.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ClearingExceptionParty', 'A party to the trade that claims a clearing exception, such as an end-user exception under Dodd-Frank Act provisions.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ClearingFirm', 'Organization that submits the trade to a clearing house on behalf of the principal. Synonyms/alternates: Futures Commission Merchant (FCM), Clearing Broker, Clearing Member Firm. Some implementations use ''Clearing Broker'' as synonym.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ClearingOrganization', 'The organization that acts as a central counterparty to clear a derivatives contract.  This is used to represent the role of Central Counterparties (CCPs) or Derivative Clearing Organizations (DCOs).  Sometimes called ''ClearingService''. Some implementations also use the term ''Clearer''.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Client', 'Client as defined under ESMA MIFIR. This is generally the investor or other client of an investment firm, and is synonymous with the Beneficiary in many circumstances.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ClientDecisionMaker', 'The party or person who, having legal authority to act on behalf of a trade counterparty, made the decision to acquire or sell the financial instrument.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('CompressionServiceProvider', 'The party that acts as a compression service provider, by compressing existing portfolios of trades to reduce notional amount outstanding, the number of transactions or otherwise harmonise the terms, by combining or offsetting trades and commonly to replace the terminated derivatives with new replacement trades.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ConfirmationPlatform', 'Organization serving as a financial intermediary for the purposes of electronic confirmation or providing services for post-processing of transactional data.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ContractualParty', 'A party to a contractual document.  If the intended usage relates to the context of the trade lifecycle, more specific annotations have been defined which might be more appropriate.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('CounterPartyAffiliate', 'Organization officially attached to the counterparty. e.g. partner, branch, subsidiary.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('CounterPartyUltimateParent', 'The topmost entity or organization, within the corporate hierarchy, responsible for the reporting party.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Counterparty', 'An economic counterparty to the trade. Synonym: principal.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('CreditSupportProvider', 'Organization that enhances the credit of another organization (similar to guarantor, but may not fully guarantee the obligation).');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Custodian', 'Organization that maintains custody of the asset represented by the trade on behalf of the owner/principal.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('DataSubmitter', 'Entity submitting the transaction report to the competent authority.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('DeterminingParty', 'The party referenced is specified in the contract confirmation as Determination Party.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('DisputingParty', 'Organization that is disputing the trade or transaction.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('DocumentRepository', 'A marketplace organization which purpose is to maintain document records.  If the intended usage relates to the context of the trade lifecycle, more specific annotations have been defined which might be more appropriate.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ExecutingBroker', 'The (generally sell-side) organization that executed the trade; the price-making party.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ExecutingEntity', 'Entity executing the transaction.  If the transaction is executed directly by the reporting party, it will be the reporting party.  If it is executed by an execution agent or an affiliated party on behalf of the reporting party, it will be that affiliate or agent.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ExecutionAgent', 'The (generally buy-side) organization that acts to execute trades on behalf of an investor. Typically this is an investment manager or asset manager, and also makes the investment decisions for the investor. If required, a separate InvestmentDecision role can be specified to distinguish that the party making the investment decision is different.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ExecutionFacility', 'The facility, exchange, or market where the trade was executed. Synonym: Swap Execution Facility, Designated Contract Market, Execution Venue.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Guarantor', 'Organization that backs (guarantees) the credit risk of the trade.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('HedgingParty', 'The ISDA Hedging Party that is specified in the related confirmation as Hedging, or if no Hedging Party is specified, either party to the contract.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Lender', 'The party that lends out securities under stock lending arrangements as principal.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('OrderTransmitter', 'The entity transmitting the order to the reporting firm. Synonym: Transmitting Firm.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('PTRRServiceProvider', 'The party that acts as either a portfolio compression or portfolio rebalancing service provider, as defined under ESMA MIFIR');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Pledgor', 'The party that provides credit support under New York Law.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('PrimeBroker', 'The organization that takes on or took on the credit risk for this trade by stepping in between the two economic parties (without a central counterparty clearing mechanism).');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('PriorTradeRepository', 'The trade repository at which the trade was reported previous to the current trade repository.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('PublicationVenue', 'The reporting service (whether trade repository, market data service, or exchange/facility/venue data distribution service) that published the report of this trade.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ReportingParty', 'The party with the regulatory responsibility to report this trade.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ReportingPartyAffiliate', 'Organization officially attached to the reporting party  e.g. partner, branch, subsidiary.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ReportingPartyUltimateParent', 'The topmost entity or organization, within the corporate hierarchy, responsible for the reporting party.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('SecuredParty', 'The party that receives credit support under New York or English Law.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('Seller', 'A counterparty in a trade, which performs in one of the following capacities: 1) it transfers or agrees to transfer in the future an instrument or title to that instrument in exchange for payment, 2) it writes a derivatives instrument such as an option or a swap in which it provides risk protection to the buyer. This does not refer to the broker/dealer or other organization on what is typically called  the ''Sell side''; for that, see the ''Executing Broker'' role. Corresponds to ''Seller'' as defined in certain regulations such as ESMA MiFID II/MIFIR RTS 22 field 16.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('SellerDecisionMaker', 'The party or person who, having legal authority to act on behalf of the trade counterparty acting as Seller as defined in this coding scheme, made the decision to sell the financial instrument. Corresponds to ''seller decision maker'' as defined in ESMA''s MIFIR RTS 23 report. This does not refer to the decision maker for what is traditionally called the ''Sell side''; for that, see the ''Trader'' person role.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('SettlementAgent', 'The organization that makes or receives payments on behalf of the given principal party.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('ThirdPartyCustodian', 'A third-party providing custody, settlement, segregation and reporting services.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('TradeRepository', 'An organization that maintains records of the trade for regulatory reporting purposes.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('TradeSource', 'The organization that originally supplied the record of the trade. In the context of regulatory reporting, it is the submitter of the trade record to a regulator or TR.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('TradingManager', 'The entity responsible for managing the assets/investments of this party.  Synonym:  Asset Manager, Investment Manager, Trading Advisory.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('TradingPartner', 'An entity with which this party trades from time to time, ie. with which it acts as a counterparty on some transactions.   This role is used for static reference data, not individual transactions.');
INSERT INTO cdm_base_staticdata_party.PartyRoleEnum (PartyRoleEnum, Description) VALUES ('TripartyAgent', 'A third party entity that acts as an intermediary and provides automated clearing, settlement, allocation, valuation and reporting services.');
INSERT INTO cdm_event_workflow.WarehouseIdentityEnum (WarehouseIdentityEnum, Description) VALUES ('DTCC_TIW_Gold', 'The DTCC Trade Information Warehouse Gold service');
INSERT INTO cdm_base_math.RoundingModeEnum (RoundingModeEnum, Description) VALUES ('Down', NULL);
INSERT INTO cdm_base_math.RoundingModeEnum (RoundingModeEnum, Description) VALUES ('Up', NULL);
INSERT INTO cdm_product_asset.DiscountingTypeEnum (DiscountingTypeEnum, Description) VALUES ('AFMA', 'As specified by the Australian Financial Markets Association (AFMA) OTC Financial Product Conventions. This discounting method should not be used for a trade documented under a legal framework where the 2006 ISDA Definitions have been incorporated.');
INSERT INTO cdm_product_asset.DiscountingTypeEnum (DiscountingTypeEnum, Description) VALUES ('FRA', 'As specified by the 2006 ISDA Definitions, Section 8.4. Discounting, paragraph (b).');
INSERT INTO cdm_product_asset.DiscountingTypeEnum (DiscountingTypeEnum, Description) VALUES ('FRAYield', 'As specified by the 2006 ISDA Definitions, Section 8.4. Discounting, paragraph (e).');
INSERT INTO cdm_product_asset.DiscountingTypeEnum (DiscountingTypeEnum, Description) VALUES ('Standard', 'As specified by the 2006 ISDA Definitions, Section 8.4. Discounting, paragraph (a).');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeA', 'Denotes cash in the form of money credited to an account in any currency, or similar claims for the repayment of money, such as money market deposits.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeB', 'Denotes gold in the form of allocated pure gold bullion of recognised good delivery.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeC', 'Denotes debt securities issued by the central government of the United Kingdom or the Bank of England.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeD', 'Denotes debt securities issued by United Kingdom regional governments or local authorities whose exposures are treated as exposures to the central government of the United Kingdom in accordance with Article 115(2) of Regulation (EU) No 575/2013.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeE', 'Denotes debt securities issued by United Kingdom public sector entities whose exposures are treated as exposures to the central government, regional government or local authority of the United Kingdom in accordance with Article 116(4) of Regulation (EU) No 575/2013.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeF', 'Denotes debt securities issued by United Kingdom regional governments or local authorities other than those referred to in (TypeD).');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeG', 'Denotes debt securities issued by United Kingdom public sector entities other than those referred to in (TypeE).');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeH', 'Denotes debt securities issued by multilateral development banks listed in Article 117(2) of Regulation (EU) No 575/2013.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeI', 'Denotes debt securities issued by the international organisations listed in Article 118 of Regulation (EU) No 575/2013.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeJ', 'Denotes debt securities issued by third countries'' governments or central banks.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeK', 'Denotes debt securities issued by third countries'' regional governments or local authorities that meet the requirements of (TypeD) and (TypeE).');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeL', 'Denotes debt securities issued by third countries'' regional governments or local authorities other than those referred to in (TypeD) and (TypeE).');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeM', 'Denotes debt securities issued by credit institutions or investment firms including bonds admitted to the register of regulated covered bonds maintained under Regulation 7(1)(b) of the Regulated Covered Bonds Regulations 2008 (SI 2008/346).');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeN', 'Denotes corporate bonds.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeO', 'Denotes the most senior tranche of a securitisation, as defined in Article 4(61) of Regulation (EU) No 575/2013, that is not a re-securitisation as defined in Article 4(63) of that Regulation.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeP', 'Denotes convertible bonds provided that they can be converted only into equities which are included in an index specified pursuant to point (a) of Article 197 (8) of Regulation (EU) No 575/2013.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeQ', 'Denotes equities included in an index specified pursuant to point (a) of Article 197(8) of Regulation (EU) No 575/2013.');
INSERT INTO cdm_base_staticdata_asset_common.UK_EMIR_EligibleCollateralEnum (UK_EMIR_EligibleCollateralEnum, Description) VALUES ('UK_EMIRTypeR', 'Denotes shares or units in undertakings for UK UCITS, provided that the conditions set out in Article 5 of EU Regulation 2016/2251 (as modified by the Technical Standards (European Market Infrastructure) (EU Exit) (No. 3) Instrument 2019) are met.');
