INSERT INTO cdm_base_math.QuantifierEnum (QuantifierEnum, Description) VALUES ('Any', 'Specifies that the condition in the scope of the quantifier is true of at least one member of the domain i.e. one or more of the elements in scope.');
INSERT INTO cdm_base_datetime.PeriodExtendedEnum (PeriodExtendedEnum, Description) VALUES ('C', 'CalculationPeriod - the period corresponds to the calculation period   For example, used in the Commodity Markets to indicate that a reference contract is the one that corresponds to the period of the calculation period.');
INSERT INTO cdm_base_datetime.PeriodExtendedEnum (PeriodExtendedEnum, Description) VALUES ('D', 'Day');
INSERT INTO cdm_base_datetime.PeriodExtendedEnum (PeriodExtendedEnum, Description) VALUES ('H', 'Hour');
INSERT INTO cdm_base_datetime.PeriodExtendedEnum (PeriodExtendedEnum, Description) VALUES ('M', 'Month');
INSERT INTO cdm_base_datetime.PeriodExtendedEnum (PeriodExtendedEnum, Description) VALUES ('T', 'Term. The period commencing on the effective date and ending on the termination date. The T period always appears in association with periodMultiplier = 1, and the notation is intended for use in contexts where the interval thus qualified (e.g. accrual period, payment period, reset period, ...) spans the entire term of the trade.');
INSERT INTO cdm_base_datetime.PeriodExtendedEnum (PeriodExtendedEnum, Description) VALUES ('W', 'Week');
INSERT INTO cdm_base_datetime.PeriodExtendedEnum (PeriodExtendedEnum, Description) VALUES ('Y', 'Year');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Allocation', 'The intent is to allocate one or more trades as part of an allocated block trade.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('CashFlow', 'The intent is to designate a stand-alone cash transfer as a result of Trade contracual terms e.g. incurred by payout for instance a Performance Amount or a Floating Rate Amount. The particular CashFlow at stake shall be further specified in priceTransferEnum or transferTypeEnum. For clarity, such intentEnum value shall not be used whenever a cash transfer is not stand-alone but is instead embedded in another Event as part of the composable modelling e.g. Decrease with Fees, Cross-Currency Notional Reset, etc. or any other Event whenever including a cash transfer with other features. For clarity, a principal payment related to a Principal Exhange is excluded as well, because a dedicated intentEnum value exists for this event i.e. PrincipalExchange value.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Clearing', 'The intent is to clear the contract.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Compression', 'The intent is to compress multiple trades as part of a netting or compression event.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('ContractFormation', 'The intent is to form a contract from an execution.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('ContractTermsAmendment', 'The intent is to amend the terms of the contract through renegotiation.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('CorporateActionAdjustment', 'The intent is to take into effect the occurrence of a Corporate Action and the particular Corporate Action at stake shall be further specified in CorporateActionTypeEnum.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('CreditEvent', 'The intent is to take into effect the occurrence of a Credit Event.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Decrease', 'The intent is to Decrease the quantity or notional of the contract.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('EarlyTerminationProvision', 'The intent is to fully unwind the Trade, as a result of the application of Trade contractual terms (e.g. an obligation to do so before Termination Date as part of any kind of Early Termination terms) as defined within the CDM EarlyTerminationProvision data type. Accordingly, increase and decrease of positions which result from negotiation by the parties shall not be designated by such intentEnum. For clarity, partial exercise of an option before its expiration date is excluded as well, though related to Trade contract terms, because a dedicated intentEnum value exists for this event i.e. OptionExercise value.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Increase', 'The intent is to Increase the quantity or notional of the contract.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('IndexTransition', 'The intent is to replace an interest rate index by another one during the life of a trade and add a transition spread on top of this index (and on top of the spreads already defined in the trade, if any). ');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('NotionalReset', 'The intent is to increase or to decrease the notional of the Trade, in accordance with Notional Reset features e.g. could apply for Cross Currency Swaps, Equity Performance Swaps, etc.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('NotionalStep', 'The intent is to increase or to decrease the notional of the Trade, in accordance with Step features attached to a Payout Quantity.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Novation', 'The intent is to novate the contract.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('ObservationRecord', 'The intent is to record any kind of stand-alone obervervations e.g. internal data recording, usage of CDM for recording and/or exchanging data as part of pricing ''consensus'' processing, etc. For clarity, such intentEnum value shall not be used whenever an observation is not stand-alone but is instead embedded in another Event as part of the composable modelling e.g. CashFlow to which an observation of prices is associated, etc.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('OptionExercise', 'The intent is to Exercise a contract that is made of one or several option payout legs. For clarity, such intentEnum value shall not be used whenever an optional right is exercised in relation with a Trade which composition includes other types of payout legs e.g. right to call or to cancel before Termination Date as part of any kind of Early Termination terms other than genuine bermuda or american style features described in option payout. ');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('OptionalCancellation', 'The intent is to cancel the trade through exercise of an optional right as defined within the CDM OptionProvision data type.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('OptionalExtension', 'The intent is to extend the trade through exercise of an optional right as defined within the CDM OptionProvision data type.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('PortfolioRebalancing', 'The intent is to rebalance a portfolio, by inserting new derivatives transactions into portfolios of participants to reduce risks linked to those trades. These are offsetting trades that rebalance relationships between different counterparties when it comes to exposure of portfolios to certain types of risk, such as interest rate risk.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('PrincipalExchange', 'The intent is to pay or to receive a cash transfer, in accordance with Principal Exchange features.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Reallocation', 'The intent is to reallocate one or more trades as part of an allocated block trade.');
INSERT INTO cdm_event_common.EventIntentEnum (EventIntentEnum, Description) VALUES ('Repurchase', 'The intent is to close a repo transaction through repurchase.');
INSERT INTO cdm_product_common_schedule.PayRelativeToEnum (PayRelativeToEnum, Description) VALUES ('CalculationPeriodEndDate', 'Payments will occur relative to the last day of each calculation period.');
INSERT INTO cdm_product_common_schedule.PayRelativeToEnum (PayRelativeToEnum, Description) VALUES ('CalculationPeriodStartDate', 'Payments will occur relative to the first day of each calculation period.');
INSERT INTO cdm_product_common_schedule.PayRelativeToEnum (PayRelativeToEnum, Description) VALUES ('LastPricingDate', 'Payments will occur relative to the last Pricing Date of each Calculation Period.');
INSERT INTO cdm_product_common_schedule.PayRelativeToEnum (PayRelativeToEnum, Description) VALUES ('ResetDate', 'Payments will occur relative to the reset date.');
INSERT INTO cdm_product_common_schedule.PayRelativeToEnum (PayRelativeToEnum, Description) VALUES ('ValuationDate', 'Payments will occur relative to the valuation date.');
