INSERT INTO cdm_legaldocumentation_master.NationalizationOrInsolvencyOrDelistingEventEnum (NationalizationOrInsolvencyOrDelistingEventEnum, Description) VALUES ('CancellationAndPayment', 'The trade is terminated.');
INSERT INTO cdm_legaldocumentation_master.NationalizationOrInsolvencyOrDelistingEventEnum (NationalizationOrInsolvencyOrDelistingEventEnum, Description) VALUES ('NegotiatedCloseout', 'The parties may, but are not obliged, to terminate the transaction on mutually acceptable terms and if the terms are not agreed then the transaction continues.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('AdHocDate', 'The dividend date will be specified ad-hoc by the parties, typically on the dividend ex-date.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CashSettlePaymentDateExDiv', 'If ''Dividend Payment Date(s)'' is specified in the Transaction Supplement as ''Cash Settlement Payment Date – Ex Dividend'''', then the Dividend Payment Date in respect of a Dividend Amount shall be the Cash Settlement Payment Date relating to the end of the Dividend Period during which the Shares commenced trading ''ex'' the relevant dividend on the Exchange.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CashSettlePaymentDateIssuerPayment', 'If ''Dividend Payment Date(s)'' is specified in the Transaction Supplement as ''Cash Settlement Payment Date – Issuer Payment'', then the Dividend Payment Date in respect of a Dividend Amount shall be the Cash Settlement Payment Date relating to the end of the Dividend Period during which the issuer pays the relevant dividend to a holder of record provided that in the case where the Equity Amount Payer is the party specified to be the sole Hedging Party and the Hedging Party has not received the Dividend Amount by such date, then the date falling a number of Currency Business Days as specified in the Cash Settlement Payment Date after actual receipt by the Hedging Party of the Received Ex Amount or Paid Ex Amount (as applicable).');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CashSettlementPaymentDate', 'If ''Dividend Payment Date(s)'' is specified in the Transaction Supplement as ''Cash Settlement Payment Date'', then the Dividend Payment Date in respect of a Dividend Amount shall be the Cash Settlement Payment Date relating to the end of the Dividend Period during which the Shares commenced trading ''ex'' the relevant dividend on the Exchange.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeEquityExDiv', 'Total of dividends which go ex, paid on next following Equity Payment Date, which is immediately following the Dividend Period during which the Shares commence trading ex-dividend on the Exchange.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeEquityExDivBeforeReset', 'Total of paid dividends, paid on next following Equity Payment Date, which is immediately following the Dividend Ex Date, unless the Dividend Ex Date is between the Equity Valuation and Payment Date in which case the dividend is deferred to the following Equity Payment Date');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeEquityPaid', 'Total of paid dividends, paid on next following Equity Payment Date, which is immediately following the Dividend Period during which the dividend is paid by the Issuer to the holders of record of a Share.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeEquityPaidBeforeReset', 'Total of paid dividends, paid on next following Equity Payment Date, which is immediately following the Dividend Pay Date, unless the Dividend Pay Date is between the Equity Valuation and Payment Date (not including the Valuation Date) in which case the dividend is deferred to the following Equity Payment Date');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeEquityPaidInclReset', 'Total of paid dividends, paid on next following Equity Payment Date, which is immediately following the Dividend Pay Date, unless the Dividend Pay Date is between the Equity Valuation and Payment Date (including the Valuation Date) in which case the dividend is deferred to the following Equity Payment Date');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeInterestExDiv', 'Total of dividends which go ex, paid on next following Interest Payment Date, which is immediately following the Dividend Period during which the Shares commence trading ex-dividend on the Exchange, or where the date on which the Shares commence trading ex-dividend is a Payment Date, such Payment Date.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeInterestPaid', 'Total of paid dividends, paid on next following Interest Payment Date, which is immediately following the Dividend Period during which the dividend is paid by the Issuer to the holders of record of a Share.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeInterestPaidBeforeReset', 'Total of paid dividends, paid on next following Interest Payment Date, which is immediately following the Dividend Pay Date, unless the Dividend Pay Date is between the Equity Valuation and Payment Date (not including the Valuation Date) in which case the dividend is deferred to the following Interest Payment Date.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('CumulativeInterestPaidInclReset', 'Total of paid dividends, paid on next following Interest Payment Date, which is immediately following the Dividend Pay Date, unless the Dividend Pay Date is between the Equity Valuation and Payment Date (including the Valuation Date) in which case the dividend is deferred to the following Interest Payment Date.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('DividendPaymentDate', 'Date on which the dividend will be paid by the issuer.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('DividendValuationDate', 'In respect of each Dividend Period, the relevant Dividend Valuation Date.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('EquityPaymentDate', 'Equity payment date of the swap.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('ExDate', 'Date on which a holder of the security is entitled to the dividend.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('FloatingAmountPaymentDate', 'If ''Dividend Payment Date(s)'' is specified in the Transaction Supplement as ''Floating Amount Payment Date'', then the Dividend Payment Date in respect of a Dividend Amount shall be the first Payment Date falling at least one Settlement Cycle after the date that the Shares have commenced trading ''ex'' the relevant dividend on the Exchange.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('FollowingPaymentDate', 'The next payment date of the swap.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('RecordDate', 'Date on which the dividend will be recorded in the books of the paying agent.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('SharePayment', 'If ''Dividend Payment Date(s)'' is specified in the Transaction Supplement as ''Share Payment'', then the Dividend Payment Date in respect of a Dividend Amount shall fall on a date on or before the date that is two (or any other number that is specified in the Transaction Supplement) Currency Business Days following the day on which the Issuer of the Shares pays the relevant dividend to holders of record of the Shares.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('TerminationDate', 'Termination date of the swap.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('TradeDate', 'Trade date of the swap');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('UnwindExDiv', 'Pays a fraction of the total on each Unwind Trade Settlement Date which occurs after the Dividend Ex Date, until trade is fully unwound.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('UnwindOrEquityExDiv', 'Pays a fraction of the Dividend Amount on each Unwind Trade Settlement Date which occurs after the Dividend Ex Date, until position is fully unwound OR on the next Equity Pay Date after the Dividend Pay Date. This will be whichever date comes first or a combination of both.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('UnwindOrEquityPaid', 'Pays a fraction of the Dividend Amount on each Unwind Trade Settlement Date which occurs after the Dividend Pay Date, until position is fully unwound OR on the next Equity Pay Date after the Dividend Pay Date. This will be whichever date comes first or a combination of both.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('UnwindOrInterestExDiv', 'Pays a fraction of the Dividend Amount on each Unwind Trade Settlement Date which occurs after the Dividend Ex Date, until position is fully unwound OR on the next Interest Pay Date after the Dividend Ex Date. This will be whichever date comes first or a combination of both.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('UnwindOrInterestPaid', 'Pays a fraction of the Dividend Amount on each Unwind Trade Settlement Date which occurs after the Dividend Pay Date, until position is fully unwound OR on the next Interest Pay Date after the Dividend Pay Date. This will be whichever date comes first or a combination of both.');
INSERT INTO cdm_product_asset.DividendDateReferenceEnum (DividendDateReferenceEnum, Description) VALUES ('UnwindPaid', 'Pays a fraction of the total on each Unwind Trade Settlement Date which occurs after the Dividend Pay Date, until trade is fully unwound.');
